import assert from 'assert';

describe('Client', function () {

    describe('Page Level', function () {

        it('Get title', function () {
            browser.url('/');
            let title = browser.getTitle();
            assert.equal(title, 'Bug Tracker');
        })

        it('Favicon', function () {
            browser.url('/favicon.ico');
            let icon = $('img');
            let width = icon.getCSSProperty('width').parsed.value;
            let height = icon.getCSSProperty('height').parsed.value;
            let size = `${width}x${height}`;
            assert.equal(size, '256x256');
        })

    });

    describe('Elements exist', function () {

        it('Header', function () {
            browser.url('/');
            let header = $('.custom-header').isDisplayed();
            assert.equal(header, true);
        })

        it('App', function () {
            let header = $('.site-content').isDisplayed();
            assert.equal(header, true);
        })

        it('Footer', function () {
            let header = $('.custom-footer').isDisplayed();
            assert.equal(header, true);
        })

    });

});
let maxLenght = 45;

describe('Login', function () {

    describe('Email', function () {

        it('Max Characters', function () {
            browser.url('/');
            let input = $('#email');
            input.addValue('j'.repeat(maxLenght));
            let actual = input.getValue().length;
            input.clearValue();
            assert.equal(actual, maxLenght);
        })

        it('Max Characters + 1', function () {
            let input = $('#email');
            input.addValue('j'.repeat(maxLenght + 1));
            let actual = input.getValue().length;
            assert.equal(actual, maxLenght);
        })

        it('Login | Email | Verify that font size: 16px', function () {
            let email = $('#email');
            let fontSize = email.getCSSProperty('font-size').parsed.value;
            console.log(fontSize);
            assert.equal(fontSize, '16');
        })

        it('Placeholder text', function () {


            $('#registration').click();

            let text = $('#email').getAttribute('placeholder');

            assert.equal(text, 'Email *');

        });
    });

    describe ('Forgot Password', function () {


        it('Forgot Password exists', function () {
            $('#back').click();
            let forgotPass = $('#forgot').isDisplayed();
            assert.equal (forgotPass, true);

        })



    })
});

describe('Registration', function () {

    describe('First Name', function () {

        it('Max Characters', function () {
            let fnameMaxLength  = 20;
            browser.url('/');
            $('#registration').click();
            let input = $('#fname');
            input.addValue('f1%^B'.repeat(fnameMaxLength / 5));
            let actual = input.getValue().length;
            input.clearValue();
            assert.equal(actual, fnameMaxLength);
        })

    })
})

